import React from 'react';

function About() {
  return (
    <div>
      <h1>About Us</h1>
      <p>SSE Home Decor is dedicated to providing quality home improvement products with a focus on style, durability, and customer satisfaction. Our team is passionate about helping you create a beautiful and comfortable home.</p>
    </div>
  );
}

export default About;
